import React from 'react';
import Card from './Card';
// import { persons } from './persons';

const CardList = ({ persons }) => {
	const cardsArray = persons.map((value, i) => {
			return (<Card 
			key={i} 
			name={persons[i].name} 
			age={persons[i].age} 
			gender={persons[i].gender}/>
		)});
	return (
		<div>
			{cardsArray}
		</div>
	);
}

export default CardList;

